import React from 'react';
import './Home.css'

function Home() {
  return (
    <>
    <div className="wrapper">
      <div className="left">
      <div className="signin">
      <div className="logo">
        <img src="/Images/Project.jpg" alt="AnimeWorld" />
        </div>
      </div>
      </div>
      </div>

    </>
  );
}

export default Home;
